# https://leetcode.com/problems/subarray-sums-divisible-by-k/
from typing import List
from collections import defaultdict

class Solution:
    def subarraysDivByK(self, nums: List[int], k: int) -> int:
        # temp = []
        # count = 0
        # # 이럴 필요가 없었네,,나머지가 0이면 되서,,
        # if any(nums) == False:
        #     return 0
        # else:
        #     # subarray 만드는 식
        #     for i in range(len(nums)):
        #         for j in range(i, len(nums)):
        #             temp.append(nums[i: j + 1])
        #     for t in range(len(temp)):
        #         if sum(temp[t]) % k == 0:
        #             count += 1
        # return count

        # 짜증나네요,,
        count = 0
        sum = 0
        # 누적합 나머지 count
        prefixRe = defaultdict(int)
        prefixRe[0] = 1
        for n in nums:
            sum += n
            re = sum % k
            count += prefixRe[re]
            prefixRe[re] += 1
        return count

